Just received the news that our film “Protecting the River Krupa” got into the  Blue Water Film Festival in San Diego! ✨ It is amazing how these films are having life on their own reaching all these audiences around the world. So happy we can share the story of the river Krupa with so many. 🙏

Watch the full short documentary film produced for @nature_org on the link in bio.

Thank you to all the festivals that screened our film and nominated it to various awards!

@bluewaterfilmfestival @swindonfilmfest @sffrozenfilmfestival@travelfestalbania
@hightatrasfilmfestival @zagreb_tourfilm_festival @oregon.documentary.film.fest @ataff_szolnok @innsbrucknaturefilmfestival @echomountainfilmfestival @cinemaverde #LifeScreeningsInternationalShortFilmFestival

#NatureConservancy #RiverProtection #ProtectOurPlanet

This is the story of Bosnian diver Sanja Mitric.  I am proud to finally share a special global campaign we worked on for @nature_org The Nature Conservancy at @tentfilm . It is one of those dream meaningful projects. We were given the task to produce 8 short films about river champions and guardians, from scientists to locals who are trying to protect rivers in the Balkans. We spent most of this June on the field, working in 5 Balkan countries: North Macedonia, Serbia, Bosnia and Herzegovina, Croatia, and Montenegro.

Production: @tentfilm
Client: @nature_org @alexsnyderphoto 
Director: @ciriljazbec
Cinematographers @maticek @ciriljazbec
Editor: @lukas_miheljak
Sound design: Julij Zornik
Creative director: @katarinajaz
Executive Producer: @ajduush
Colorist: Teo Rižnar
Production Assistants: @klemen_skubic @ausmalark
Graphic design: @urska.alic

The Western Balkans region is home to some of Europe’s last free-flowing rivers. There is a growing movement of people who are fighting to protect these unique ecosystems for generations to come.

Thanks to the talented River Champions for their spirit, hospitality and participation.

