While some believe that the Jaguar is the most ferocious animal in the Amazon, I personally feel that the prize goes to the Giant River Otters that call the rivers down there home. Not only are they pack hunters, but they don't seem to take crap from anyone, including Jaguars. Sometime soon I will share a video of a Jaguar hiding in a tree to get away from 6 Giant River Otters hassling it from the water below. What a sight!

