IT’S MY BIRTHDAY TODAY! Which means I’ve been taking photographs for 19 years now. 🤯 Comment below how old you think I am.🤔😝🥳 .
//
I’ve spent several birthdays in different parts of the world. Last birthday, after 20+ months of roaming the Americas, I was at ‘The End Of The Earth’ in Patagonia. I summited Mount Fitzroy with legends and curated my greatest Lightroom Collection to date, ‘TWIN FLAME’ (link in bio)
.
//
19 years ago, I only dreamt about grand adventures and life altering souls I’d meet along the way. Now, after so many years, miles, and memories captured, I realize there is still so much life to be lived and loved. No matter how old you are (I’m now 34) it’s never too late to begin a new journey and one day look back on, as well, full of love & light. 💛🗺💫💙

