Acabando meus dias nesse paraíso. A natureza nos coloca no nosso devido lugar com nosso tamanho e importância. E viver esses momentos nem sempre são fáceis, a vida atropela a gente toda hora. De alegrias, mas também de responsabilidades, de culpa, de problemas de ordens tão distintas. 

Vivam todos os momentos. Os esperados, com cara de sonho e os pequenos, vento no rosto, um mergulho no mar, um beijo na boca, uma lua cheia. Se conecte e reconecte com essa vida que é muito breve. 

